import React, { useState } from 'react';
import { Bot, Building2, Utensils, Towel, LogOut, CheckCircle, Bell } from 'lucide-react';

const initialPortfolio = [
  { 
    name: 'וילה יוקרתית - קיסריה', 
    rooms: [{ id: 'K1', name: 'סוויטת מסטר', status: 'תפוס', guest: 'משפחת אהרוני' }] 
  },
  { 
    name: 'פנטהאוז רוטשילד - ת"א', 
    rooms: [{ id: 'T1', name: 'סוויטת פרימיום', status: 'פנוי', guest: '-' }] 
  }
];

function App() {
  const [portfolio, setPortfolio] = useState(initialPortfolio);
  const [aiLog, setAiLog] = useState(["מערכת AI מוכנה לפעולה..."]);

  const sendToAI = async (type, roomName, propName) => {
    const timestamp = new Date().toLocaleTimeString();
    let actionDesc = "";
    
    // הגדרת תיאור הפעולה ללוג
    if (type === 'checkout') actionDesc = `צ'ק-אאוט ב${roomName}: הזנקת צוות ניקיון.`;
    if (type === 'towels') actionDesc = `בקשה למגבות ב${roomName}: עודכן משק בית.`;
    if (type === 'restaurant') actionDesc = `הזמנת שולחן מ${roomName}: בוצע רישום במסעדה.`;

    setAiLog(prev => [`[${timestamp}] ${actionDesc}`, ...prev.slice(0, 4)]);

    // שליחה לשרת הפייתון
    try {
      await fetch('http://127.0.0.1:5000/ai_action', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ type, room: roomName, property: propName }),
      });
    } catch (e) {
      console.log("שרת פייתון לא מגיב, אבל האוטומציה נרשמה מקומית.");
    }
  };

  return (
    <div style={{ padding: '30px', backgroundColor: '#020617', color: 'white', minHeight: '100vh', direction: 'rtl', fontFamily: 'Segoe UI' }}>
      
      {/* Header */}
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '30px', borderBottom: '1px solid #1e293b', paddingBottom: '20px' }}>
        <h1 style={{ color: '#3b82f6', margin: 0, display: 'flex', alignItems: 'center', gap: '10px' }}>
          <Bot size={35} /> LuxuryStay AI Management
        </h1>
        <div style={{ textAlign: 'left' }}>
          <span style={{ color: '#10b981' }}>● System Online</span>
          <div style={{ fontSize: '0.8em', color: '#64748b' }}>Connected to Airbnb API</div>
        </div>
      </div>

      {/* AI Live Log */}
      <div style={{ background: '#0f172a', border: '1px solid #3b82f6', padding: '15px', borderRadius: '12px', marginBottom: '30px' }}>
        <h4 style={{ margin: '0 0 10px 0', color: '#3b82f6', display: 'flex', alignItems: 'center', gap: '8px' }}>
          <Bell size={18} /> יומן פעולות AI (בזמן אמת):
        </h4>
        {aiLog.map((log, i) => (
          <div key={i} style={{ fontSize: '0.9em', color: i === 0 ? '#fff' : '#64748b', marginBottom: '5px' }}>
            {log}
          </div>
        ))}
      </div>

      {/* Properties Grid */}
      {portfolio.map((prop, pIdx) => (
        <div key={pIdx} style={{ marginBottom: '30px', background: '#1e293b', padding: '25px', borderRadius: '20px' }}>
          <h2 style={{ marginBottom: '20px', display: 'flex', alignItems: 'center', gap: '10px' }}>
            <Building2 color='#3b82f6' /> {prop.name}
          </h2>
          
          {prop.rooms.map((room, rIdx) => (
            <div key={rIdx} style={{ background: '#0f172a', padding: '20px', borderRadius: '15px', display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <div>
                <h4 style={{ margin: '0 0 5px 0' }}>{room.name}</h4>
                <div style={{ fontSize: '0.85em', color: '#94a3b8' }}>אורח: {room.guest}</div>
              </div>

              <div style={{ display: 'flex', gap: '15px' }}>
                <button onClick={() => sendToAI('checkout', room.name, prop.name)} style={btnStyle('#ef4444')}>
                  <LogOut size={16} /> יציאה
                </button>
                <button onClick={() => sendToAI('towels', room.name, prop.name)} style={btnStyle('#f59e0b')}>
                  <Towel size={16} /> מגבות
                </button>
                <button onClick={() => sendToAI('restaurant', room.name, prop.name)} style={btnStyle('#10b981')}>
                  <Utensils size={16} /> מסעדה
                </button>
              </div>
            </div>
          ))}
        </div>
      ))}
    </div>
  );
}

const btnStyle = (color) => ({
  background: 'transparent',
  border: `1px solid ${color}`,
  color: color,
  padding: '8px 15px',
  borderRadius: '8px',
  cursor: 'pointer',
  display: 'flex',
  alignItems: 'center',
  gap: '8px',
  transition: '0.3s'
});

export default App;
